import React from "react";
import styled from "styled-components";
import MNButton from "../ui/menuBT";
import Template from "../ui/template";



const MainTitleText = styled.p`
    font-size: 40px;
    font-weight: 900;
    text-align: center;
    color: #FFFFFF;
    letter-spacing: 2px;
    position: absolute;
    width: 241px;
    height: 58px;
    left: 23px;
    top: 27px;
`;





function Writepage(props) {

    return (
        <Template>
            <MainTitleText>알쏭달쏭?!</MainTitleText>
            <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
                <p>
                <form>
            <fieldset>
                <legend><MNButton title="카테고리" /></legend>
                패션 <input type="radio" name="category" value="fashion" checked />
                가전 <input type="radio" name="category" value="appliance" />
                뷰티 <input type="radio" name="category" value="beauty" />
                식품 <input type="radio" name="category" value="grocery" />
            </fieldset>
        </form></p>
                <p><MNButton title="누가" /></p>
                <p><MNButton title="언제" /></p>
                <p><MNButton title="무엇을" /></p>
                <p><MNButton title="내용" /></p>
                <p><MNButton title="링크" /></p>
                <p><MNButton title="중요도" /></p>

        </Template>
           
       
    );
}

export default Writepage;
